import React from "react";
import { Link } from "react-router-dom";
import "./front.css"; // Import the CSS file

function Front() {
  return (
    <div>
      <h1>WELCOME TO PROJECT TRACKER</h1>
      <div>
        <Link to="/login">
          <button>Login</button>
        </Link>
        <Link to="/register">
          <button>Register</button>
        </Link>
      </div>
    </div>
  );
}

export default Front;
